import React from 'react';

const topPart = {
    margin: "100px",
    height: "40vh",
    width: "100%",
}

export default function Frontpage() {
    return (
        <div className="d-flex justify-content-center">
            <div className="h-50 d-inline-block">
                <h1 className="display-3">Hey, I'm <strong className="text-danger">Nikolaj Jensen</strong>.</h1>
                <p className="h2">Specialized <strong className="text-danger">biologist</strong> and experienced <strong className="text-danger">programmer</strong></p>
                <p className="h2">I design and code awesome stuff, and I love what I do!</p>
                <p className="p-5">
                    <button className="btn btn-outline-dark btn-lg" type="button" href="#carouselExampleControls">See my work</button>
                </p>
            </div>
        </div>

    )
}
